def read(file):
    f = open(file, 'r')
    contents = f.read()
    f.close()
    return contents

#decode
def convert(d):
    with open('output_file.zip', 'wb') as result:
        result.write(base64.b64decode(d))
    zip_ref = zipfile.ZipFile("output_file.zip", 'r')
    zip_ref.extractall("extracted_file")
    zip_ref.close()

    with ZipFile('output_file.zip', 'r') as zipObj:
        # Get a list of all archived file names from the zip
        listOfFileNames = zipObj.namelist()
        # Iterate over the file names
        for fileName in listOfFileNames:
            # Check filename endswith csv
            if fileName.endswith('package.json'):
                # Extract a single file from zip
                print("yes")
                zipObj.extract(fileName, 'temp.json')

    #for filename in os.listdir("extracted_file"):
    #    print(filename)

